sys_variable_value.value:
(function execute(inputs, outputs) {

    outputs.classifications = getUniqueClassificationValues(inputs.release);

function getUniqueClassificationValues(release) {
    let records = new GlideAggregate('rm_story');
    records.addQuery('release', release);
    records.addAggregate('COUNT', 'classification');
    records.groupBy('classification');
    records.query();
    let uniqueClassificationValues = [];
    while (records.next()) {
        uniqueClassificationValues.push(records.getValue('classification'));
    }
    return uniqueClassificationValues;
}
})(inputs, outputs);

